-- ----------------------------
-- View structure for mywork_view
-- ----------------------------
DROP VIEW IF EXISTS "public"."mywork_view";
CREATE VIEW "public"."mywork_view" AS  SELECT member.user_id,
    member.member_name,
    project.project_id,
    project.project_name,
    projecthint.project_hint,
    listwork.listwork_serno,
    list.list_id,
    list.list_name,
    work.work_id,
    work.work_title,
    work.work_content,
    work.deadline,
    tag1.tag_id AS tag_id1,
    tag1.tagname AS tagname1,
    tag1.color AS color1,
    tag2.tag_id AS tag_id2,
    tag2.tagname AS tagname2,
    tag2.color AS color2,
    tag3.tag_id AS tag_id3,
    tag3.tagname AS tagname3,
    tag3.color AS color3,
    tag4.tag_id AS tag_id4,
    tag4.tagname AS tagname4,
    tag4.color AS color4,
    tag5.tag_id AS tag_id5,
    tag5.tagname AS tagname5,
    tag5.color AS color5,
    tag6.tag_id AS tag_id6,
    tag6.tagname AS tagname6,
    tag6.color AS color6,
    work.file_name,
    work.file,
    work.first_principal,
    work.second_principal,
    first_principal.photo AS principal_photo1,
    second_principal.photo AS principal_photo2,
    workhint.work_hint
   FROM ((((((((((((((((member
     JOIN teammember ON (((teammember.user_id)::text = (member.user_id)::text)))
     JOIN project ON (((project.project_id)::text = (teammember.project_id)::text)))
     JOIN projectlist ON (((projectlist.project_id)::text = (project.project_id)::text)))
     LEFT JOIN projecthint ON (((projecthint.project_id)::text = (project.project_id)::text)))
     LEFT JOIN list ON ((list.list_id = projectlist.list_id)))
     LEFT JOIN listwork ON ((listwork.list_id = list.list_id)))
     LEFT JOIN work ON (((work.work_id = listwork.work_id) AND (((work.first_principal)::text = (member.user_id)::text) OR ((work.second_principal)::text = (member.user_id)::text)))))
     LEFT JOIN tag tag1 ON ((tag1.tag_id = work.tag_id1)))
     LEFT JOIN tag tag2 ON ((tag2.tag_id = work.tag_id2)))
     LEFT JOIN tag tag3 ON ((tag3.tag_id = work.tag_id3)))
     LEFT JOIN tag tag4 ON ((tag4.tag_id = work.tag_id4)))
     LEFT JOIN tag tag5 ON ((tag5.tag_id = work.tag_id5)))
     LEFT JOIN tag tag6 ON ((tag6.tag_id = work.tag_id6)))
     LEFT JOIN member first_principal ON (((work.first_principal)::text = (first_principal.user_id)::text)))
     LEFT JOIN member second_principal ON (((work.second_principal)::text = (second_principal.user_id)::text)))
     LEFT JOIN workhint ON (((workhint.work_id)::text = (work.work_id)::text)));

