   FROM ((project
     JOIN projectpermission ON (((projectpermission.project_id)::text = (project.project_id)::text)))
     JOIN teammember ON (((teammember.project_id)::text = (projectpermission.project_id)::text)));

-- ----------------------------
-- View structure for project_view
-- ----------------------------
DROP VIEW IF EXISTS "public"."project_view";
CREATE VIEW "public"."project_view" AS  SELECT project.project_id,
    project.project_name,
    teammember.user_id,
    member.photo,
    member.member_name,
    teammember.group_id,
    teammember.isadmin,
    projectpermission.projectpermission_serno,
    projectpermission.list_permission,
    projectpermission.add_work,
    projectpermission.edit_work,
    projectpermission.delete_work,
    projectlist.projectlist_serno,
    list.list_id,
    list.list_name,
    work.work_id,
    work.work_title,
    work.work_content,
    work.deadline,
    work.tag_id1,
    tag1.tagname AS tagname1,
    tag1.color AS color1,
    work.tag_id2,
    tag2.tagname AS tagname2,
    tag2.color AS color2,
    work.tag_id3,
    tag3.tagname AS tagname3,
    tag3.color AS color3,
    work.tag_id4,
    tag4.tagname AS tagname4,
    tag4.color AS color4,
    work.tag_id5,
    tag5.tagname AS tagname5,
    tag5.color AS color5,
    work.tag_id6,
    tag6.tagname AS tagname6,
    tag6.color AS color6,
    work.file,
    work.file_name,
    work.first_principal,
    work.second_principal
   FROM (((((((((((((list
     JOIN projectlist ON ((projectlist.list_id = list.list_id)))
     JOIN project ON (((project.project_id)::text = (projectlist.project_id)::text)))
     JOIN projectpermission ON (((projectpermission.project_id)::text = (project.project_id)::text)))
     JOIN teammember ON (((teammember.project_id)::text = (projectpermission.project_id)::text)))
     JOIN member ON (((member.user_id)::text = (teammember.user_id)::text)))
     LEFT JOIN listwork ON ((listwork.list_id = projectlist.list_id)))
     LEFT JOIN work ON ((work.work_id = listwork.work_id)))
     LEFT JOIN tag tag1 ON ((tag1.tag_id = work.tag_id1)))
     LEFT JOIN tag tag2 ON ((tag2.tag_id = work.tag_id2)))
     LEFT JOIN tag tag3 ON ((tag3.tag_id = work.tag_id3)))
     LEFT JOIN tag tag4 ON ((tag4.tag_id = work.tag_id4)))
     LEFT JOIN tag tag5 ON ((tag5.tag_id = work.tag_id5)))
     LEFT JOIN tag tag6 ON ((tag6.tag_id = work.tag_id6)));

